        <img src="/static/gilbproducing.png" alt="" target="_blank"></img>
          <h3 className="title is-3">Foxworth Consulting</h3>
          <p>There is no commitment necessary. Everybody is dealing with enough priority overload already. We should flow, and that’s just how it goes.</p>
        </div>
      </div>
      <style jsx>{`
        #current-projects {
          text-align: center;
          background-color: white;
        }
        img {
          height: 250px;
          width:  250px;
          margin-bottom:10px;
          margin-left: 175px;
          border-radius: 50%;
          text-align: center;
        }
        .elevator {
          text-align: center;
        }
        .title {
          font-weight: bold;
          text-align: center;
        }
        .p {
          margin-left: 50px;
        }
      `}</style>
  </div>    
  )

  export default CurrentProjects
